var junk =
  "";

document.querySelector("#messages").insertAdjacentHTML(
  "beforeend",
  `
  <div>
  100kb.waterfall ${Date.now() - window.performance.timing.navigationStart}
  </div>
  `
);

(async () => {
  // Request API.
  const response = await fetch("./js/api.json?ts=" + Date.now()).then((res) =>
    res.json()
  );
  console.log(response);
  // Simulate extra delay from server.
  const { promise, resolve } = Promise.withResolvers();
  setTimeout(resolve, 200);
  await promise;
  document.querySelector("#messages").insertAdjacentHTML(
    "beforeend",
    `
<div>
API response ${Date.now() - window.performance.timing.navigationStart}
</div>
`
  );

  // Load extensions.
  for (const letter of ["b", "c", "d"]) {
    const el = document.createElement("script");
    el.src = `./js/100kb.${letter}.js`;
    el.async = true;
    document.head.insertAdjacentElement("beforeend", el);
  }
})();
